import React, { useEffect } from 'react';
import { observer } from 'mobx-react-lite';
import ProductCard from '../Components/ProductCard';
import productStore from '../Stores/ProductStore';
import './ProductsPage.css'

const ProductsPage = () => {

  useEffect(() => {
    const fetchProducts = async () => {
      const response = await fetch('https://dummyjson.com/products');
      const products = await response.json();
      productStore.setProducts(products.products);
    };

    fetchProducts();
  }, []);


  return (
    <div className='row'>
      <div className='column'> <ProductCard key={productStore.products[0].id} product={productStore.products[0]} className="product-card" /> </div>
      <div className='column'> <ProductCard key={productStore.products[1].id} product={productStore.products[1]} className="product-card" /> </div>
      <div className='column'> <ProductCard key={productStore.products[2].id} product={productStore.products[2]} className="product-card" /> </div>
    </div>
  );
};

export default observer(ProductsPage);
